import React, {useState, useEffect} from 'react'
import './App.css';


function App() {

    const [data, setData] = useState([{}])

    useEffect( () => {
        fetch("/users").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
  return(
      <div>
                {
                    (typeof data.users === 'undefined') ? (<p>Loading...</p>):

                    (
                        data.users.map((user, i) => (
                        <p key = {i}> {user[1]}</p>
                    ))
                  )
                }
      </div>
  )
}

export default App
